import { Component, OnInit } from '@angular/core';
import { Observable, of } from 'rxjs';
import { UnsplashService } from '../unsplash.service';

@Component({
  selector: 'app-unsplash',
  template: `<div *ngFor="let photo of photos"><img [src]="photo.urls.small"/></div>`,
  templateUrl: './unsplash.component.html',
  styleUrls: ['./unsplash.component.scss'],
  styles:[]
})
export class UnsplashComponent implements OnInit {
  photos: any;

  constructor(private unsplashService: UnsplashService) {}


  ngOnInit(){
    this.unsplashService.getPhotos().subscribe(photos => {
      this.photos = photos;
    });
  }

}
